import React from "react";
import "./style.css";

function Products(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt={props.name} src={props.image} />
      </div>
      <div className="content">
        <h2></h2>{props.name}
        <p></p>{props.description}
        <button>{props.price}</button> 

      </div>
    </div>
  );
}

export default Products;
